import React from 'react';
import Stripe from '../Stripe';
import '../styles/Media.css';

const Media = () => {
    return(
        <div>
            <Stripe title="Media" description="Learn more about corporate sustainability"></Stripe>
            <div style={{display:"flex", marginTop:"10%"}}>
                <div style={{display:"flex"}}>
                    <div style={{backgroundColor:"red",padding:"2rem",flexDirection:"column"}}></div>
                    <p style={{fontSize:"2rem",fontWeight:"3rem", maxWidth:"30rem"}}>In today's world, it's more important than ever for companies to prioritize sustainable practices.</p>
                    <div style={{backgroundColor:"red",padding:"2rem",flexDirection:"column"}}></div>
                    <p style={{flexDirection:"row"}}>Join us as we explore the latest trends, ideas, and solutions for improving corporate sustainability.</p>
                </div>
            </div>
        </div>
    );
};

export default Media;
